import React from 'react';
import { Card, Avatar } from 'antd';

const UserProfile = () => {
    return (
        <Card
            actions={[
                <div key="twit">짹짹<br /></div>
            ]}
        >
             <Card.Meta
                 avatar={<Avatar>OY</Avatar>}
                 title="OH YEAH"
             />
        </Card>
    )
}

export default UserProfile;
